import React from 'react';
import {withRouter} from 'react-router';
import {ImageComponentLayout} from './imageComponet/layout'
import {wordList} from '../../assets/textFiles/wordList'

class WordComponent extends React.Component {
    constructor(props){
        super(props);
        this.currentWord = 0;
    }
    render() {
        return (
            <div>
                <ImageComponentLayout word={wordList[this.currentWord]}/>
            </div>
        );
    }
}

export const WordComponentView = withRouter(WordComponent);
